// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.4;

import "./Registry.sol";
import "./Repository.sol";

/// @title Registry Royalties
/// @dev This contract manages royalty distribution for software dependencies
contract RegistryRoyalties {
    // Reference to the main registry contract
    Registry public immutable registry;

    // Royalty settings - can be adjusted based on your tokenomics
    uint256 public constant DIRECT_ROYALTY_BASIS_POINTS = 500; // 5% for direct dependencies
    uint256 public constant INDIRECT_ROYALTY_BASIS_POINTS = 200; // 2% for indirect dependencies
    uint256 public constant BASIS_POINTS_DENOMINATOR = 10000; // For percentage calculations
    uint256 public constant MAX_DEPTH = 5; // Maximum dependency tree depth to prevent gas issues

    // Store pending royalties for each creator
    mapping(address => uint256) public pendingRoyalties;

    // Array to track processed dependencies
    bytes32[] private _processedKeysForTransaction;

    // Events
    event RoyaltyPaid(
        address indexed creator,
        uint256 amount,
        uint256 softwareId,
        uint256 depth,
        uint256 timestamp
    );

    event RoyaltiesWithdrawn(
        address indexed creator,
        uint256 amount,
        uint256 timestamp
    );

    constructor(address _registry) {
        registry = Registry(_registry);
    }

    // Helper function to get processed keys
    function _getProcessedKeys() private view returns (bytes32[] storage) {
        return _processedKeysForTransaction;
    }

    // Function to reset the processed keys array before each transaction
    function _resetProcessedKeys() private {
        delete _processedKeysForTransaction;
    }

    /// @notice Distributes royalties across all dependencies when a license is purchased
    /// @param buyer Address of the buyer
    /// @param seller Address of the seller
    /// @param repositoryAddr Address of the repository contract containing the software
    /// @param softwareId ID of the software being licensed
    /// @param paymentAmount Total payment amount
    function distributeRoyalties(
        address buyer,
        address seller,
        address repositoryAddr,
        uint256 softwareId,
        uint256 paymentAmount
    ) external {
        // Only the marketplace should call this
        require(msg.sender == registry.marketplace(), "Only marketplace can distribute royalties");

        // Verify repository is registered
        require(registry.isRepository(repositoryAddr), "Repository not registered");

        // Reset processed keys for this transaction
        _resetProcessedKeys();

        // Start recursive distribution at depth 1
        _processRoyalties(
            repositoryAddr,
            softwareId,
            paymentAmount,
            1 // Starting at depth 1
        );
    }

    // Modify the _processRoyalties function to reduce local variables
    function _processRoyalties(
        address repositoryAddr,
        uint256 softwareId,
        uint256 paymentAmount,
        uint256 depth
    ) private {
        // Stop if we've reached maximum depth to prevent excessive gas consumption
        if (depth > MAX_DEPTH) return;

        // Create a unique key for this software by combining repository address and tokenId
        bytes32 processKey = keccak256(abi.encodePacked(repositoryAddr, softwareId));

        // Check if this dependency has already been processed
        bytes32[] storage processedKeys = _getProcessedKeys();
        for (uint i = 0; i < processedKeys.length; i++) {
            if (processedKeys[i] == processKey) {
                return; // Already processed this dependency
            }
        }

        // Mark as processed
        processedKeys.push(processKey);

        // Process creator royalty
        _processCreatorRoyalty(repositoryAddr, softwareId, paymentAmount, depth);

        // Process dependencies
        _processDependencies(repositoryAddr, softwareId, paymentAmount, depth);
    }

    // Helper function to process creator royalty
    function _processCreatorRoyalty(
        address repositoryAddr,
        uint256 softwareId,
        uint256 paymentAmount,
        uint256 depth
    ) private {
        Repository repository = Repository(repositoryAddr);

        // Get the creator
        address creator;
        try repository.getCreator(softwareId) returns (address _creator) {
            creator = _creator;
        } catch {
            // Skip if we can't get creator
            return;
        }

        // Calculate royalty based on depth
        uint256 royaltyBasisPoints = (depth == 1) ?
            DIRECT_ROYALTY_BASIS_POINTS :
            INDIRECT_ROYALTY_BASIS_POINTS;

        uint256 royaltyAmount = (paymentAmount * royaltyBasisPoints) / BASIS_POINTS_DENOMINATOR;

        // Add royalty to creator's pending balance
        if (royaltyAmount > 0 && creator != address(0)) {
            pendingRoyalties[creator] += royaltyAmount;
            emit RoyaltyPaid(creator, royaltyAmount, softwareId, depth, block.timestamp);
        }
    }

    // Helper function to process dependencies
    function _processDependencies(
        address repositoryAddr,
        uint256 softwareId,
        uint256 paymentAmount,
        uint256 depth
    ) private {
        Repository repository = Repository(repositoryAddr);

        // Get dependencies
        address[] memory depAddresses;
        uint256[][] memory depTokenIds;

        try repository.getDirectDependencies(softwareId) returns (
            address[] memory _depAddresses,
            uint256[][] memory _depTokenIds
        ) {
            depAddresses = _depAddresses;
            depTokenIds = _depTokenIds;
        } catch {
            // If we can't get dependencies, just return
            return;
        }

        // Process each dependency
        for (uint i = 0; i < depAddresses.length; i++) {
            _processDepGroup(depAddresses[i], depTokenIds[i], paymentAmount, depth);
        }
    }

    // Helper function to process a group of dependencies from a single repository
    function _processDepGroup(
        address depRepoAddr,
        uint256[] memory tokenIds,
        uint256 paymentAmount,
        uint256 depth
    ) private {
        // Skip invalid repositories
        if (!registry.isRepository(depRepoAddr)) return;

        // Process each token ID in the dependency
        for (uint j = 0; j < tokenIds.length; j++) {
            // Recursively process this dependency's royalties at next depth
            _processRoyalties(
                depRepoAddr,
                tokenIds[j],
                paymentAmount,
                depth + 1
            );
        }
    }

    /// @notice Allows a creator to withdraw their accumulated royalties
    function withdrawRoyalties() external {
        uint256 amount = pendingRoyalties[msg.sender];
        require(amount > 0, "No royalties to withdraw");

        // Reset pending royalties before transfer to prevent reentrancy
        pendingRoyalties[msg.sender] = 0;

        // Transfer the royalties to the creator
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "Transfer failed");

        emit RoyaltiesWithdrawn(msg.sender, amount, block.timestamp);
    }

    /// @notice Check pending royalties for a specific creator
    /// @param creator Address of the creator
    /// @return Amount of pending royalties
    function getRoyaltiesForCreator(address creator) external view returns (uint256) {
        return pendingRoyalties[creator];
    }

    // Function to receive ETH when royalties are sent to this contract
    receive() external payable {}
}

